import React, {useEffect} from 'react'
import { connect } from 'react-redux'
import ReactLoginMS from "react-ms-login";
import { getBntwData } from '../../actions/getBntwData'

class TrackingMain extends React.Component {

    componentDidMount(){
        this.props.getBntwData()
    }

    render(){
        return(
            <div>
                <ReactLoginMS
                clientId="a8e594de-9520-49b6-9f12-56936e20d2e2"
                redirectUri="http://localhost:3000/ms" 
                cssClass="ms-login" 
                btnContent="LOGIN WITH MICROSOFT"
                responseType="code"
                handleLogin={(data) => console.log(data)}
                />
                <h1>TrackingMain</h1>
            </div>
        )
    }

}



const mapDispatchToProps = dispatch => ({
    getBntwData: () => dispatch(getBntwData())
})

export default connect (0, mapDispatchToProps)(TrackingMain)
